function getReport()
{


    var motivo =$("#idMotivo").val();
    var concepto  = 20;
    var fechaIn = $("#idIniFec").val();
    var fechaFn = $("#idFinFec").val();

    $.ajax
    ({

        url : '../datos/datos.averias_recibidas.php',
        type : 'POST',
        dataType : 'json',
        data : { tip : 'report',motivo: motivo,concepto : concepto,fechaIn : fechaIn, fechaFn : fechaFn },
        success : function(res) {
            swal.close();
            // var dat = JSON.parse(res);

            if ( $.fn.dataTable.isDataTable( '#dataTable' ) ) {
                $('#dataTable').DataTable().destroy();
            }

           var table= $('#dataTable').DataTable( {
                data: res,
                dom: 'lfrtip',
                columns: [
                    {title: "ID"},
                    {title: "OBSERVACION"},
                    {title: "FECHA"},
                    {title: "NOMBRE"},
                    {title: "TELEFONO"},
                    {title: "DIRECCION"},
                    {title: "EMAIL"},
                    {title: "LATITUD"},
                    {title: "LONGITUD"},
                    {title: "MOTIVO"},
                    {"defaultContent": "<button type='button' id='mostrarDetalles' class='btn btn-primary glyphicon glyphicon-eye-open'> Detalles</button>"}



                ],
                "columnDefs": [
                    {
                        "targets": [ 7 ],
                        "visible": false,
                        "searchable": false
                    },

                    {
                        "targets": [ 8 ],
                        "visible": false,
                        "searchable": false
                    },

            {
                        "targets": [ 6 ],
                        "visible": false,
                        "searchable": false
                    }
                ],

                "lengthMenu": [[10, 25, 50, -1], [10, 25, 50, "Todos"]],
                "info": false,
                "paging": true,
                "order":false,
                "language":  {url: '../../js/DataTables-1.10.15/Spanish.json'}

            });
            setInterval( function () {
                table.ajax.reload( null, false ); // user paging is not reset on reload
            }, 1000000 );
            obtener_data_editar("#dataTable tbody", table);

            $('#dataTable').show();

        },

        error : function(xhr, status) {

        }

    });

}


